    private <T> void test(T[] inputs){
        MyQueue<T> queue = new MyQueue<>();
        assertTrue(queue.isEmpty());
        queue = convertToMyQueue(inputs);
        if(inputs.length>0){
            assertFalse(queue.isEmpty());
        }else{
            assertTrue(queue.isEmpty());
        }
        try{
            for (T input : inputs) {
                assertFalse(queue.isEmpty());
                assertEquals(input, queue.peek());
                assertEquals(input, queue.remove());
            }
            assertTrue(queue.isEmpty());
        }catch(Exception e){
            fail("ERROR\r\n" + e.getMessage());
        }
    }

    private <T> MyQueue<T> convertToMyQueue(T[] inputs) {
        MyQueue<T> output = new MyQueue<>();
        for (T input: inputs) {
            output.add(input);
        }
        return output;
    }
